import React from 'react';
const category = () => (
    <ul className="gnb">
        <li>
            <a href="#none" className="tab_day on">life</a>
        </li>
        <li>
            <a href="#none" className="tab_day">party</a>
        </li>
    </ul>
)
export default category;
